import React, { useEffect, useState } from "react";
import { useLocales } from "../../../locales";
// react router dom
import { Link as RouterLink, useNavigate } from "react-router-dom";
// @mui
import {
  Button,
  IconButton,
  Table,
  Tooltip,
  TableBody,
  TableContainer,
  CircularProgress,
  Box,
} from "@mui/material";

// components
import Iconify from "../../../components/iconify";
import Scrollbar from "../../../components/scrollbar";
import ConfirmDialog from "../../../components/confirm-dialog";
import { useSettingsContext } from "../../../components/settings";
import {
  useTable,
  getComparator,
  emptyRows,
  TableNoData,
  TableEmptyRows,
  // TableHeadCustom,
  TableSelectedAction,
  TableHeadCustom,
} from "../../../components/table";
import { styled } from "@mui/material/styles";
import PendingOrdersRow from "./details/PendingOrdersTableRow";
// redux
import { useDispatch, useSelector } from "react-redux";
// pagination
import OrdersPendingPagination from "../../../components/pagination/OrdersPendingPagination";
import LoadingTableRows from "../../../components/loadingSkeleton/LoadingTableRows";

// ----------------------------------------------------------------------

const TABLE_HEAD = [
  { id: "order_number", label: "order_number", align: "center" },
  { id: "order_time", label: "order_time", align: "center" },
  { id: "order_location", label: "order_location", align: "center" },
  { id: "meals", label: "meals", align: "center" },
  { id: "price", label: "price", align: "center" },
  { id: "delivery_name", label: "delivery_name", align: "center" },
  { id: "order_status", label: "order_status", align: "center" },
  { id: "action", label: "action", align: "center" },
];

// ---------- Styles --------------
const StyledTableContainer = styled(TableContainer)(({ theme }) => ({
  position: "relative",
  overflow: "unset",
  borderColor: theme.palette.primary.main,
  border: "1px solid #ECECEC",
  borderRadius: "25px",
  background: "#fff",
  // padding:'0px 24px'
  "& .MuiTable-root": {
    padding: " 0px 24px!important",
    borderSpacing: "0px 16px",
  },
}));

const tableHolderSx = {
  minWidth: 800,
  borderCollapse: "separate",
  borderSpacing: "0px 30px",
  paddingRight: "19px",
  paddingLeft: "19px",
};

export default function PendingOrdersList() {
  const dispatch = useDispatch();

  const { pendingOrder, isLoadingPendingOrder } = useSelector(
    (state) => state.orders
  );

  const {
    dense,
    page,
    order,
    orderBy,
    rowsPerPage,
    setPage,
    //
    selected,
    setSelected,
    onSelectRow,
    onSelectAllRows,
    //
    onSort,
    onChangeDense,
    onChangePage,
    onChangeRowsPerPage,
  } = useTable();

  const { translate } = useLocales();

  const { themeStretch } = useSettingsContext();

  const navigate = useNavigate();

  const [tableData, setTableData] = useState([]);

  const [openConfirm, setOpenConfirm] = useState(false);

  const [filterName, setFilterName] = useState("");

  const [filterRole, setFilterRole] = useState("all");

  const [filterStatus, setFilterStatus] = useState("all");

  const dataFiltered = applyFilter({
    inputData: tableData,
    comparator: getComparator(order, orderBy),
    filterName,
    filterRole,
    filterStatus,
  });
  const dataInPage = dataFiltered?.slice(
    page * rowsPerPage,
    page * rowsPerPage + rowsPerPage
  );
  const denseHeight = dense ? 52 : 72;
  const isFiltered =
    filterName !== "" || filterRole !== "all" || filterStatus !== "all";
  const isNotFound =
    (!dataFiltered?.length && !!filterName) ||
    (!dataFiltered?.length && !!filterRole) ||
    (!dataFiltered?.length && !!filterStatus);

  const handleOpenConfirm = () => {
    setOpenConfirm(true);
  };

  const handleCloseConfirm = () => {
    setOpenConfirm(false);
  };

  const handleDeleteRow = (id) => {
    const deleteRow = tableData?.filter((row) => row.id !== id);
    setSelected([]);
    setTableData(deleteRow);

    if (page > 0) {
      if (dataInPage.length < 2) {
        setPage(page - 1);
      }
    }
  };

  const handleDeleteRows = (selected) => {
    const deleteRows = tableData?.filter((row) => !selected.includes(row.id));
    setSelected([]);
    setTableData(deleteRows);

    if (page > 0) {
      if (selected.length === dataInPage.length) {
        setPage(page - 1);
      } else if (selected.length === dataFiltered?.length) {
        setPage(0);
      } else if (selected.length > dataInPage.length) {
        const newPage =
          Math.ceil((tableData?.length - selected.length) / rowsPerPage) - 1;
        setPage(newPage);
      }
    }
  };

  useEffect(() => {}, [dispatch]);

  useEffect(() => {
    setTableData(pendingOrder);
  }, [pendingOrder]);

  // ------------ JSX Code --------------
  return (
    <>
      {/* ***************** Table ***************** */}
      <StyledTableContainer>
        <TableSelectedAction
          dense={dense}
          numSelected={selected.length}
          rowCount={tableData?.length}
          onSelectAllRows={(checked) =>
            onSelectAllRows(
              checked,
              tableData?.map((row) => row.id)
            )
          }
          action={
            <Tooltip title="Delete">
              <IconButton color="primary" onClick={handleOpenConfirm}>
                <Iconify icon="eva:trash-2-outline" />
              </IconButton>
            </Tooltip>
          }
        />
        <Scrollbar>
          <Table size={dense ? "small" : "medium"} sx={{ ...tableHolderSx }}>
            <TableHeadCustom
              order={order}
              orderBy={orderBy}
              headLabel={TABLE_HEAD}
              rowCount={tableData.length}
              numSelected={selected.length}
              onSort={onSort}
              onSelectAllRows={(checked) =>
                onSelectAllRows(
                  checked,
                  tableData.map((row) => row.id)
                )
              }
            />
            <TableBody>
              {!isLoadingPendingOrder ? (
                <>
                  {dataFiltered
                    ?.slice(
                      page * rowsPerPage,
                      page * rowsPerPage + rowsPerPage
                    )
                    .map((row, index) => (
                      <PendingOrdersRow
                        // key={row.id}
                        key={index * 2}
                        row={row}
                        selected={selected.includes(row.orderId)}
                        onSelectRow={() => onSelectRow(row.orderId)}
                        onDeleteRow={() => handleDeleteRow(row.orderId)}
                      />
                    ))}

                  <TableEmptyRows
                    height={denseHeight}
                    emptyRows={emptyRows(page, rowsPerPage, tableData?.length)}
                  />

                  <TableNoData isNotFound={isNotFound} />
                </>
              ) : (
                <LoadingTableRows number={5} cellsNum={10} />
              )}
            </TableBody>
          </Table>
        </Scrollbar>
        {/* --- Strat Table Pagenation --- */}
        <OrdersPendingPagination
          count={dataFiltered?.length}
          page={page}
          rowsPerPage={rowsPerPage}
          onPageChange={onChangePage}
          onRowsPerPageChange={onChangeRowsPerPage}
          dense={dense}
          onChangeDense={onChangeDense}
        />
      </StyledTableContainer>

      {/* ***************** Confirm Daialog popup ***************** */}
      <ConfirmDialog
        open={openConfirm}
        onClose={handleCloseConfirm}
        title="Delete"
        content={
          <>
            Are you sure want to delete <strong> {selected.length} </strong>{" "}
            items?
          </>
        }
        action={
          <Button
            variant="contained"
            color="error"
            onClick={() => {
              handleDeleteRows(selected);
              handleCloseConfirm();
            }}
          >
            Delete
          </Button>
        }
      />
    </>
  );
}

// ----------------------------------------------------------------------

function applyFilter({
  inputData,
  comparator,
  filterName,
  filterStatus,
  filterRole,
}) {
  const stabilizedThis = inputData.map((el, index) => [el, index]);

  stabilizedThis.sort((a, b) => {
    const order = comparator(a[0], b[0]);
    if (order !== 0) return order;
    return a[1] - b[1];
  });

  inputData = stabilizedThis.map((el) => el[0]);

  if (filterName) {
    inputData = inputData.filter(
      (user) => user.name.toLowerCase().indexOf(filterName.toLowerCase()) !== -1
    );
  }

  if (filterStatus !== "all") {
    inputData = inputData.filter((user) => user.status === filterStatus);
  }

  if (filterRole !== "all") {
    inputData = inputData.filter((user) => user.role === filterRole);
  }

  return inputData;
}
